# https://leetcode.com/problems/count-the-number-of-fair-pairs/

class Solution:
    def bisect(self, arr, x, lr=True, lo=0):
        hi = len(arr)
        while lo < hi:
            mid = (lo + hi) // 2
            match lr:
                case True:
                    if arr[mid] < x:
                        lo = mid + 1
                    else:
                        hi = mid
                case False:
                    if arr[mid] <= x:
                        lo = mid + 1
                    else:
                        hi = mid
        return lo
    
    def countFairPairs(self, nums: List[int], lower: int, upper: int) -> int:
        nums.sort()
        n = len(nums)
        res = 0
        for i in range(n-1):
            low = self.bisect(nums, lower - nums[i], True, i + 1)
            high = self.bisect(nums, upper - nums[i], False, i + 1)
            res += high - low
        return res

